function center_x(team_num) {


  var divide_num = Number(team_num) + 1;

  const start = 200;
  const increment = 300;




  if (divide_num % 4 == 1) {

    return start; // 250 px between the squares

  }


  if (divide_num % 4 == 2) {

    return start + (increment);

  }

  if (divide_num % 4 == 3) {

    return start + (increment * 2);

  }

  if (divide_num % 4 == 0) {

    return start + (increment * 3);

  }




}


function center_y(team_num, conf_num) {


  var id_column = Math.floor(team_num / 4) * 300

  return (conf_y[conf_num].position) + id_column;


}








function Getfill(i) {

  if (json[i].ortg >= 112.5) {

  return "#30cc5a";


  }

  if (112.5 > json[i].ortg && json[i].ortg >= 106) {

  return "#2f9e4f";


  }

  if (106 > json[i].ortg && json[i].ortg >= 99.5) {

  return "#35764e";


  }

  if (99.5 > json[i].ortg && json[i].ortg >= 93) {

  return "#8b444e";


  }

  if (93 > json[i].ortg && json[i].ortg >= 86.5) {

  return "#bf4045";


  }

  if (86.5 > json[i].ortg) {

  return "#f63538";


  }

}




